import { IonItem, IonLabel, IonList } from "@ionic/react";

function List() {
  let items: string[] = ["cip", "ciop"];
  let myList;

  items.forEach((elem: string) => {
    myList.push(
      <IonItem>
        <IonLabel>{elem}</IonLabel>
      </IonItem>
    );
  });
  return <IonList>{new String(myList)}</IonList>;
}

export default List;
